import React, { Component } from 'react'
import Navbar from 'react-bootstrap/Navbar'
import Nav from 'react-bootstrap/Nav'
import { Link } from 'react-router-dom'
import { LinkContainer } from 'react-router-bootstrap'

class HeaderComponent extends Component {
    render() {
        return (
            <header>
                <Navbar bg="dark" variant="dark">
                    <Navbar.Brand>
                        <Link to="/">Birthday Calendar</Link>
                    </Navbar.Brand>
                    <Navbar.Collapse className="justify-content-end">
                        {!this.props.isUserAuthenticated && <LinkContainer to='/signup'><Button>Get Started</Button></LinkContainer>}
                        {!this.props.isUserAuthenticated && <Nav.Link to='/login'>Log In</Nav.Link>}
                        {this.props.isUserAuthenticated && <Navbar.Text>Welcome, PlaceHolderFirstname</Navbar.Text>}
                        {this.props.isUserAuthenticated && <Nav.Link to='/logout'>Log Out</Nav.Link>}
                    </Navbar.Collapse>
                </Navbar>
            </header>
        )
    }
    
}

export default HeaderComponent
